import React from 'react';
import './App.css';
import Router from "./router/Router";

const App = () => {
  const toPostPara = (obj) => {
    let output = "";
    for (const item in obj) {
      if (obj.hasOwnProperty(item)) {
        output = output + item + "=" + obj[item] + "&"
      }
    }
    return output.substring(0, output.length - 1);
  };

  return (
    <div className="app">
      <Router/>
    </div>
  );
};

export default App;
